import React from "react";
import {BrowserRouter, Routes,Route, Redirect} from 'react-router-dom';


export default function PrivateRoutes({
  component: Component,
  isAuthenticated,
  ...rest
}) {
  return (
    <Routes>
    <Route
      {...rest}
      render={(props) =>
        isAuthenticated ? <Component {...props} /> : <Redirect to="/login" />
      }
      />
      </Routes>
  );
};
